import { Container, Grid, Box } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({

}));
const FormulaireMobin = () => {
    const classes = useStyles();

    return (
        <Container>
            <div className={classes.blocForm}>
                <div className={classes.blocTop}>
                    <div className={classes.titre}>
                        <h3>J'adhère à</h3>
                        <img className={classes.img} src={'/static/icons/mobin-webinars.png'} alt="mobin webinar" />
                    </div>
                </div>
                <div className={classes.form}>
                    <form className="flex flex-col">
                        <label htmlFor="name" className="mb-2 italic">Name</label>
                        <input
                            className="mb-4 border-b-2"
                            id="name"
                            name="name"
                            type="text"
                            autocomplete="name"
                            required
                        />
                        <button
                            type="submit"
                            className="px-4 py-2 font-bold text-white bg-blue-500 rounded-full hover:bg-blue-700"
                        >
                            Submit
                        </button>
                    </form>
                </div>
            </div>
        </Container>
    );
};

export default FormulaireMobin;
